import React from "react";
import '../App.css';
import Dropdown from 'react-dropdown';
import 'react-dropdown/style.css';

const years = () => {
  let range = [];
  for(let i = 1920; i < 2008; i++) {
    range.push(i);
  }
  return range;
}

const gender = [
  'select', 'Male', 'Female', 'Other'
];
const options = {
  gender: [
    'select', 
    'Male', 
    'Female', 
    'Other'],
  boolean: [
    'Yes', 
    'No'],
  education: [
    'Less than high school',
    'High school',
    'University degree',
    'Graduate degree'],
  area: [
    'Rural (countryside)',
    'Suburban',
    'Urban (Town, City)'],
  handedness: [
    'Right',
    'Left',
    'Both'],
  marital: [
    'Never married',
    'Currently married',
    'Previously married'],
  siblings: [
    'One',
    'Two',
    'Three',
    'Four',
    'Five or more'],
  years: years()
}

class Demographic extends React.Component {

  render() {
    return (      
      <div>

        <h1>PERSONAL INFORMATION</h1>
        {/* <div className="wallpaper">
        </div> */}
        <div >
          <ul>
            <li className="row">What is your gender?</li>
            <Dropdown className="dropdown" options={options.gender} onChange={this._onSelect} value={options.gender[0]} placeholder="Select an option" />
            <li className="row">What year were you born?</li>
            <Dropdown className="dropdown" options={options.years} onChange={this._onSelect} value="select" placeholder="Select an option" />
            <li className="row">Is English your native language?</li>
            <Dropdown className="dropdown"  options={options.boolean} onChange={this._onSelect} value="select" placeholder="Select an option" />
            <li className="row">What is your marital status?</li>
            <Dropdown options={gender} onChange={this._onSelect} value="select"  placeholder="Select an option" />
            <li className="row">Including you, how many children did your mother have?</li>
            <Dropdown options={gender} onChange={this._onSelect} value="select"  placeholder="Select an option" />
            <li className="row">Have you given accurate answers and may they be used for research?</li>
            <Dropdown options={gender} onChange={this._onSelect} value="select"  placeholder="Select an option" />
            If you attended a university, what was your major (e.g. "psychology", "English", "civil engineering")? 
          </ul>
        </div>



<form onSubmit={this.handleSubmit}>

<div className="prompt">
  <h4>What led up to the event depicted?</h4>
  <textarea 
    type="text" 
    className="text-field"
    name="past"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <h4>What is happening at the moment?</h4>
  <textarea 
    name="present"
    type="text" 
    className="text-field"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <h4>If you attended a university, what was your major (e.g. "psychology", "English", "civil engineering")?</h4>
  <textarea 
    name="feelings"
    type="text" 
    className="text-field"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <h4>What will be a likely outcome?</h4>
  <textarea 
    name="future"
    type="text" 
    className="text-field"
    // value={this.state.value} 
    // onChange={this.handleChange} 
  />
  <button className="btn btn-default tat-submit" onClick={this.save}>Submit</button>
</div>
</form>


      </div>
    );
  }
}

export default Demographic;




